import React from "react";
import springLogo from "../resources/spring-logo.png";

const SpringLogo = () => {
  return (
    <img
      src={springLogo}
      className="spring-logo spring-logo-drop-shadow"
      alt="logo"
    />
  );
};

export default SpringLogo;
